import React from "react";
import("../styles/ContactUs.css");

function ContactUs() {
  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h2>Contact Us</h2>
      <p>You can reach us at contact@bloomwell.ai</p>
    </div>
  );
}

export default ContactUs;
